style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("quotesby.co.uk") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, footer, div.chenarBlue, div.chenarGri, span.quotesSmall, .share a

{
color: white !important;
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre, div#searchPanel

{
background: #333333 !important;
}

}
